webpackJsonp([0xf927f8900006],{790:function(i,a){i.exports={data:{page:{id:"/Volumes/Zero/gatsby/eddychangme/content/pages/1--about/index.md absPath of file >>> MarkdownRemark",html:'<p>這是我(Eddy Chang)的個人部落格，記錄了許多技術性的、日常性的文章。</p>\n<p>我是一名軟體開發者，也是學校或開發教學課程的講師，目前專注於 JavaScript、React、React Native 等相關技術的研究與開發。</p>\n<h2>著(譯)作</h2>\n<ul>\n<li><a href="https://www.yottau.com.tw/course/intro/673">學好 ES6 與 React 的第一堂課 (線上課程)</a></li>\n<li>ReactJS 零基礎入門 (深石文化)</li>\n<li>Joomla! 3 精彩解說（上奇出版社）</li>\n<li><a href="https://legacy.gitbook.com/book/eyesofkids/javascript-start-from-es6/details">從 ES6 開始的 JavaScript 學習生活 (電子書)</a></li>\n<li><a href="https://legacy.gitbook.com/book/eyesofkids/javascript-start-es6-promise/details">從 Promise 開始的 JavaScript 異步生活 (電子書)</a></li>\n<li><a href="https://legacy.gitbook.com/book/eyesofkids/react-basic-zh-tw/details">React - DOM 界的彼方 (電子書)</a></li>\n</ul>\n<h2>專長</h2>\n<ul>\n<li>React</li>\n<li>React Native</li>\n<li>Redux</li>\n<li>Joomla! CMS</li>\n<li>Javascript 程式語言</li>\n<li>PHP 程式語言</li>\n<li>HTML/CSS</li>\n</ul>\n<h2>經歷</h2>\n<ul>\n<li>Joomla!繁體中文語言維護者</li>\n<li>React 新聞粉絲專頁 站長</li>\n<li>中華民國軟體自由協會 理事</li>\n<li>行政院研考會 自由軟體網路學習應用講師</li>\n<li>萬能科技大學 資訊系 講師</li>\n<li>崇右技術學院 資訊系 電子商務講師</li>\n<li>佛光大學 資訊科 講師</li>\n<li>資策會 行動開發學院 講師</li>\n<li>資擘公司 創始人&#x26;技術經理</li>\n</ul>',frontmatter:{title:"關於"}},footnote:{id:"/Volumes/Zero/gatsby/eddychangme/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>本站所有內容係採用 <a href="https://creativecommons.org/licenses/by-sa/4.0/">創用 CC 姓名標示-相同方式分享 4.0 國際</a> 授權條款授權</li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"441411672723522"}}}},pathContext:{slug:"/about/"}}}});
